import React from "react";
import "./home.css";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="section-container padding grid-container-annimation">
      <section className="hero-section">
        <div className="home-description-2 ">
          <div className="hero-title-shared">So, you want to travel to</div>
          <div className="bold-title-shared">space</div>
          <p className="center">
            Let’s face it; if you want to go to space, you might as well
            genuinely go to outer space and not hover kind of on the edge of it.
            Well sit back, and relax because we’ll give you a truly out of this
            world experience!
          </p>
        </div>
        <div className="explore_button flex">
          <Link to="/destination">
            <button className="explore">Explore</button>
          </Link>
        </div>
      </section>
    </div>
  );
};

export default Home;
